import React from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';
import { packageContact } from '../../utils/HomeData';

const PackageContact = ({ heading }) => {
    return (
        <View>
            <Text style={styles.contactHeading}>{heading}</Text>

        </View>
    );
}

const styles = StyleSheet.create({
    contactHeading: {
        padding: '10px',
        color: "#102C56",
        fontWeight: '600',
        fontSize: '22px',
        lineHeight: "24px",
        letterSpacing: '2%'
    },
    contact_Box: {
        width: '375px',
        // flex: 1,
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'space-around',
        padding: '10px',
        backgroundColor: "#fff"
    },
    contact_Flex: {
        width: '40%',
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        margin: '10px',
        backgroundColor: "#fff"
    },
    contactImg: {
        width: '24px',
        height: '24px',
    },
    contact: {
        fontSize: '22px',
        color: "#175C4C",
        fontWeight: '500',
        lineHeight: '15px',
        letterSpacing: '2%'
    },
    number: {
        width: '60%',
        backgroundColor: "#fff",
    }
})

export default PackageContact;
